The js_name attribute can be used to bind to a different function in JavaScript than the identifier that's defined in Rust. Most often, this is used to convert a camel-cased JavaScript identifier into a snake-cased Rust identifier: #[wasm_bindgen]
extern { #[wasm_bindgen(js_name = jsOftenUsesCamelCase)] fn js_often_uses_camel_case() -> u32;
} Sometimes, it is used to bind to JavaScript identifiers that are not valid Rust identifiers, in which case js_name = "some string" is used instead of js_name = ident : #[wasm_bindgen]
extern { #[wasm_bindgen(js_name = "$$$")] fn cash_money() -> u32;
} However, you can also use js_name to define multiple signatures for polymorphic JavaScript functions: #[wasm_bindgen]
extern { #[wasm_bindgen(js_namespace = console, js_name = log)] fn console_log_str(s: &str); #[wasm_bindgen(js_namespace = console, js_name = log)] fn console_log_u32(n: u32); #[wasm_bindgen(js_namespace = console, js_name = log)] fn console_log_many(a: u32, b: &JsValue);
} All of these functions will call console.log in JavaScript, but each identifier will have only one signature in Rust.

